import Header from '../components/header';
import Video from '../components/herovideo';
import Intro from '../components/intro';

const Index = () => (
    <div>
        <Header />
        <Video />
        <Intro />
      <style jsx>{`
            #my-video {
                width: 100%;
                height: 100%;
            }
      `}</style>
    </div>
)

export default Index
